 142:../../..\CubeG4\src/stm32g4xx_hal_tim.c ****     (+) CommutationCallback               : TIM Commutation Callback.
 143:../../..\CubeG4\src/stm32g4xx_hal_tim.c ****     (+) CommutationHalfCpltCallback       : TIM Commutation half complete Callback.
